        <script type="application/json" id="1033">
          {"68d1ce07-134d-468b-bf46-ef4ca86cd2ee":{"roots":{"references":[{"attributes":{"margin":[5,10,5,10],"options":["2020","2019","2018","2017","2016","2015","2014","2013","2012","2011","2010","2009","2008"],"title":"IPL Seasons","value":"2020"},"id":"1029","type":"Select"},{"attributes":{"children":[{"id":"1025"},{"id":"1026"},{"id":"1027"},{"id":"1030"}],"margin":[0,0,0,0],"name":"Column00053"},"id":"1024","type":"Column"},{"attributes":{"align":"center","margin":[5,10,5,10],"name":"","text":"&lt;p&gt;&lt;b&gt;Graph1(image scatterplot)&lt;/b&gt; depicts the modified design of scatter plot where dots are replaced by \nimages or logos of teams, This graph illustrates the matches won by each team in a season and seasons \nare selected from dropdown.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Graph2(networkx tree)&lt;/b&gt; depicts the tree implemented from networkx, it gives a brief match hierarchy for \neach season based on the value selected from season dropdown.&lt;/p&gt;\n&lt;p&gt;&lt;b&gt;Graph3(horizontal barplot)&lt;/b&gt; illustrates the maximum number of wickets made by player of each team based on teams dropdown.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph4(dotplot)&lt;/b&gt; depicts the economy rate of each player based on which the best bowler is \ndecided for each team based on the value of team drodown.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph5(histplot)&lt;/b&gt; shows the statistics of dots and conceded for \neach team based on team dropdown.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph6(kdeplot)&lt;/b&gt; illustrates the missed balls on dots throughout the matches\nfor each team based on the team dropdown&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph7(violinplot)&lt;/b&gt; depicts the number of fours conceded by bowlers in\neach team and changes based on team drop down values.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph8(violinplot)&lt;/b&gt; shows the number of sixes conceded by bowlers in\neach team and changes based on team drop down values.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph9(stripplot)&lt;/b&gt; illustrated the orange caps as in the players who had made maximum \nnumber of runs through out the seasons.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph10(barplot)&lt;/b&gt; depicts the power hitter in each team, power hitter is the one with good strike rate\n.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph11(swarmplot)&lt;/b&gt; shows the number of fours hit by each team through all the matches.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph12(boxplot)&lt;/b&gt; illustrates the number of sixes hit by each team throughout the IPL.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph13(replot)&lt;/b&gt; gives an overview of running over and runs statictics throughout the matches.&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Graph14(scatterplot)&lt;/b&gt; provides statistical view on boundaries made by each team.&lt;/p&gt;\n"},"id":"1026","type":"Div"},{"attributes":{"children":[{"id":"1031"}],"margin":[0,0,0,0],"name":"Row00052"},"id":"1030","type":"Row"},{"attributes":{"margin":[5,10,5,10],"options":["CSK","DC","RCB","RR","MI","KXIP","KKR","SRH","No Result","RPS","GL","PWI","Kochi"],"title":"IPL Team Names","value":"CSK"},"id":"1028","type":"Select"},{"attributes":{"children":[{"id":"1032"}],"margin":[0,0,0,0],"name":"Row00049"},"id":"1031","type":"Row"},{"attributes":{"align":"center","children":[{"id":"1028"},{"id":"1029"}],"margin":[0,0,0,0],"name":"Row00044"},"id":"1027","type":"Row"},{"attributes":{"align":"center","margin":[5,10,5,10],"name":"","text":"&lt;h1&gt;Indian Premier League Team Analysis&lt;/h1&gt;"},"id":"1025","type":"Div"},{"attributes":{"height":2160,"margin":[5,5,5,5],"name":"ParamFunction00045","text":"&amp;lt;img src=&amp;quot;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC0AAABDgCAYAAAD3inu6AAAAOXRFWHRTb2Z0d2FyZQBNYXRwbG90bGliIHZlcnNpb24zLjMuMiwgaHR0cHM6Ly9tYXRwbG90bGliLm9yZy8vihELAAAACXBIWXMAABYlAAAWJQFJUiTwAAEAAElEQVR4nOzdd5hcBd334e/MllRCSIiUhBaQUAJIU7oQRRF8BVREBCyAIIKiD6Ag0kQRFKQXCcIDUpUqVekREppEkUiREgMh1BRSSHZ3Zt4/dnfYZZMQEOQ5ct/Xhdk9c9qcOTPLhZ/9pVSr1WoBAAAAAAAAAAAAACiA8vt9AgAAAAAAAAAAA
